import React from 'react'
import { Col, InputNumber, Form} from 'antd';


export class InputNumComp extends React.Component {
    render() {
        const {myProp} = this.props;
        return (
            <Col span = {4}>
                <Form.Item
                    name = {this.props.name}

                >
                    <p>{this.props.label}</p>
                    <InputNumber style ={{width: '300px'}} placeholder = {this.props.placeholder}/>
                </Form.Item>

            </Col>
        )
    }
}

export default InputNumComp
